import React from 'react'

const TutorialModel = ({article}) => {
    const {title} = article.fields
    return (
        <>
            <div className="flex flex-col items-center">
                <p data-aos="fade-up" className="text_poppins_400 p-10 text-2xl sm:text-4xl md:text-5xl text-center gradient_text">{name}</p>
                <p data-aos="fade-up" data-aos-delay="100" className="text_lato text-lg typing_effect">{title}.</p>
            </div>
        </>
    )
}

export default TutorialModel
